
"""
You are given a network of n nodes, labeled from 1 to n. You are also given times, a list of travel times as directed edges times[i] = (ui, vi, wi), where ui is the source node, vi is the target node, and wi is the time it takes for a signal to travel from source to target.

We will send a signal from a given node k. Return the time it takes for all the n nodes to receive the signal. If it is impossible for all the n nodes to receive the signal, return -1.

"""
from typing import *
import collections
import heapq

class Solution:
    def networkDelayTime(self, times: List[List[int]], n: int, k: int) -> int:

        graph = collections.defaultdict(list)
        time = collections.defaultdict(int)

        for item in times:
            graph[item[0]].append(item[1])
            time[(item[0], item[1])] = item[2]

        result = collections.defaultdict(int)

        def expand_check(vertex):
            for next_vertex in graph[vertex]:
                #time out on first try when result.keys()
                if next_vertex in result:
                    default = result[next_vertex]
                    new = result[vertex] + time[(vertex, next_vertex)]
                    if default <= new:
                        continue
                    else:
                        result[next_vertex] = new
                        expand_check(next_vertex)
                else:
                    result[next_vertex] = result[vertex] + time[(vertex, next_vertex)]
                    expand_check(next_vertex)

        expand_check(k)
        if len(result) != n:
            return -1
        return max(result.values())

## faster solution
class Solution:
    def networkDelayTime(self, times: List[List[int]], n: int, k: int) -> int:
        graph = collections.defaultdict(list)
        for u, v, w in times:
            graph[u].append((v,w))

        Q = [(0, k)]
        dist = collections.defaultdict(int)

        while Q:
            time, node = heapq.heappop(Q)
            if node not in dist:
                dist[node] = time
                for v, w in graph[node]:
                    alt = time + w
                    heapq.heappush(Q, (alt, v))
        if len(dist) == n:
            return max(dist.values())
        return -1

